declare
    t_inventory_number state.inventory_number%type;
    t_store_number state.store_number%type;
    t_sensor_id state.sensor_id%type;
    t_now_state state.now_state%type;

begin 

    t_now_state := :new.now_state;
    t_inventory_number := :old.inventory_number;
    t_store_number := :old.store_number;
     t_sensor_id := :old.sensor_id;

    if t_now_state like '%Y%' then 
        values (SEQ_STATE_LOG_ID.nextval, t_inventory_number, t_store_number, t_sensor_id, sysdate, 'O' );
    elsif t_now_state like '%N%' then
        values (SEQ_STATE_LOG_ID.nextval,  t_inventory_number, t_store_number, t_sensor_id, sysdate, 'I' );
    else 
        return ;
    end if;

end;
/
